import Navbar from "./Navbar/Navbar";
import Home from "./Home/Home";
import Team from "./Team/Team";
import Footer from "./Footer/Footer";
import About from "./About/About";

function Main() {
    return (
        <>
            <Navbar />
            <Home />
            <About />
            <Team />
            <Footer />
        </>
    );
}

export default Main;
